  return(
    <div className='flex justify-around' >
    {/* <h1>Robo Friends</h1> */}
      <div className='w-20 bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
        <img alt='robot' src={`https://robohash.org/${id}?200x200`} />
        <div>
          {/* wrap it in {} because it's JSX and in JSX, js is written in {} */}
          <h2>{name}</h2> 
          <p>{email}</p>
        </div>
    </div>
  </div>
  );
}

